body {
  background: #101010;
  color: $lightgreen;
  font-family: "Monument";
}

.einleitung {
  display: flex;
  justify-content: center;
  flex-direction: column;
  height: 100vh;
  align-items: center;
  overflow: hidden;
  line-height: 1;

  .arrow {
    position: absolute;
    top: calc(100vh - 50px);
    left: 50%;
    background: $lightgreen;
    transform: translateX(-50%);
    width: 3px;
    height: 0px;
    animation: arrowani 1.5s ease 4s 2;
  }

  @keyframes arrowani {
    0% {
      height: 0px;
    }

    40% {
      top: calc(100vh - 50px);
    }

    50% {
      height: 50px;
    }

    100% {
      top: calc(100vh - 0px);
    }
  }

  .eins {
    font-weight: bold;
    font-size: 12.1vw;
  }

  .zwei {
    font-weight: bold;
    font-size: 10.42vw;
  }

  p {
    margin-top: 3rem;
    color: $black;
  }

  .drei {
    font-size: 4.42vw;
    text-transform: uppercase;
    letter-spacing: 11px;
    color: $lightgreen;
  }

  .vier {
    font-size: 4vw;
    text-transform: uppercase;
    letter-spacing: 11px;
    color: $lightgreen;
  }

  .videobackground {
    position: absolute;
    top: 0;
    left: 0;
    z-index: -2;
    height: 100vh;
    width: 100%;
  }

  .videooverlay {
    position: absolute;
    top: 0;
    left: 0;
    height: 100vh;
    width: 100%;
    background-image: linear-gradient(to top, #101010 23%, #101010c7 100%);
    z-index: -1;
  }

  video {
    width: 100%;
    max-height: 100vh;
  }

  h1 {
    font-family: "Monument";
    font-size: 8.4vw;
    text-align: center;
    font-weight: normal;
    text-transform: uppercase;
    line-height: 0.85;

    &.ourworld {
      margin-bottom: 6vh;
      color: $black;
    }
  }

  // @keyframes goout {
  //   from {
  //     line-height: 0;
  //   }

  //   to {
  //     line-height: 0.85;
  //   }
  // }

  .year {
    font-size: 28vw;

    position: relative;
    font-weight: bold;
    color: $black;

    &:before {
      content: "imJahr";
      position: absolute;
      text-transform: uppercase;
      font-size: 2vw;
      top: 78.2%;
      left: 0.8%;
      letter-spacing: 46px;
      font-weight: normal;
      z-index: 100;

      color: $lightgreen;
    }
  }
}

